import React from "react";

// const selectValue = document.querySelector(".select");

const selectDestiny = (ev) => {
  ev.currentTarget.value = this.id;
  alert(`!Tu destino es ${this.props} !`);
};

class Destiny extends React.Component {
  constructor(props) {
    super(props);
    this.props = "value1";
    this.props = "value2";
    this.props = "value3";
    this.props = "value4";
  }
  render() {
    return (
      <>
        <p>Elige tu destino</p>
        <select name="select" onChange={selectDestiny}>
          <option value="value1" id={this.props}>
            Buenos Aires
          </option>
          <option value="value2" id={this.props}>
            Sidney
          </option>
          <option value="value3" id={this.props}>
            Praga
          </option>
          <option value="value4" id={this.props}>
            Tokio
          </option>
        </select>
      </>
    );
  }
}

export default Destiny;
